"""
https://leetcode.com/problems/sort-list/description/
https://www.baeldung.com/java-merge-sort

Given the head of a linked list, return the list after sorting it in ascending order.
"""

from typing import Optional, List
import unittest

# Definition for singly-linked list.
class ListNode:
    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next


class Solution:

    def _split_array(self, array: List[int]) -> List[int]:
        l1, l2 = list(), list()
        for i, val in enumerate(array):
            if i < len(array)/2:
                l1.append(val)
            else:
                l2.append(val)
        return l1, l2

    def _to_list(self, head: ListNode) -> List[int]:
        result = list()
        iter_node = head
        while iter_node is not None:
            result.append(iter_node.val)
            iter_node = iter_node.next
        return result

    def _to_nodelist(self, array: List[int]) -> ListNode:
        nodes = list()
        for n in array:
            node = ListNode(val=n, next=None)
            if nodes:
                nodes[-1].next = node
            nodes.append(node)
        return nodes

    def _merge_sorting_algorithm(self, array: List[int]) -> ListNode:
        """
        Breaks the array into two halfs until it is not possible
        to break it anymore. Once that is done we do:
        
        1) sort each half
        2) merge those halfs
        3) sort the resulting combined array
        """
        first_half, second_half = self._split_array(array)

        if len(first_half) > 1:
            first_half = self._merge_sorting_algorithm(first_half)
        if len(second_half) > 1:
            second_half = self._merge_sorting_algorithm(second_half)

        first_half.sort()
        second_half.sort()
        combined = first_half + second_half
        combined.sort()

        return combined

    def sortList(self, head: Optional[ListNode]) -> Optional[ListNode]:
        if not head:
            return None

        array = self._to_list(head)
        result = self._merge_sorting_algorithm(array)

        return self._to_nodelist(result)[0]


class Test__solution(unittest.TestCase):

    def _to_list(self, node: ListNode) -> List[int]:
        values = list()
        current_node = node
        while current_node is not None:
            values.append(current_node.val)
            current_node = current_node.next
        return values

    def _to_nodelist(self, lst: List[int]) -> List[ListNode]:
        nodes = list()
        for n in lst:
            node = ListNode(val=n, next=None)
            if nodes:
                nodes[-1].next = node
            nodes.append(node)
        return nodes

    def test_input_1(self):
        head = [4,2,1,3]
        expected = [1, 2, 3, 4]
        returned = Solution().sortList( self._to_nodelist(head)[0] )
        assert self._to_list(returned) == expected, f'{self._to_list(returned)} != {expected}'

    def test_input_2(self):
        head = [1,2,3]
        expected = [1, 2, 3]
        returned = Solution().sortList( self._to_nodelist(head)[0] )
        assert self._to_list(returned) == expected, f'{self._to_list(returned)} != {expected}'

    def test_input_3(self):
        expected = []
        returned = Solution().sortList( None )
        assert self._to_list(returned) == expected, f'{self._to_list(returned)} != {expected}'

    def test_input_4(self):
        head = [5,5,1,4,2,4,3,2,2,7,5]
        expected = [1, 2, 2, 2, 3, 4, 4, 5, 5, 5, 7]
        returned = Solution().sortList( self._to_nodelist(head)[0] )
        assert self._to_list(returned) == expected, f'{self._to_list(returned)} != {expected}'

